import {Input, FormLabel, Box, Flex} from "@chakra-ui/react";

const InputField = (props) => {
  return(
    <Flex justify="space-between" align="center" gap="10px">
      <FormLabel color="#fff">{props.label}</FormLabel>
      <Input size="md" bg="#333" color="#fff" border="1px solid #fff" padding="5px 3px" borderRadius="8px" outline="none"/>
    </Flex>
  );
}

export default InputField;
